<template>
  <div class="hello">
    <my-a></my-a>
    <my-b></my-b>

    <template id="c">
      <div>
        <h3>BUS组件：{{name}}，{{age}}</h3>
      </div>
    </template>
    <NameListener v-bind:name="name" :age="age"/>
    <!--  模拟输入画板的图片地址  -->
    <input type="button" value="传入一个dateURL" @click="inputURL(tempDataURL)">
    <!-- 画板组件,单一入口 dataURL 和出口 reveiveFileURL -->
    <DrawBoard v-bind:dataURL="dataURL" v-on:outputFileURL="receiveFileURL"/>
  </div>
</template>

<script>
  import A from './A'
  import B from './B'
  import NameListener from "./NameListener";
  import DrawBoard from "./DrawBoard";

  import Event from '../Help/Vue.js'

  export default {
    name: 'BUS',
    data() {
      return {
        name: "",
        age: "",
        dataURL: '',
        fileURL: '',
        tempDataURL: 'data:image/jpg;base64,'
      }
    },
    methods: {
      inputURL(dataURL) {
        this.dataURL = dataURL
      },
      receiveFileURL(fileURL) {
        this.fileURL = fileURL
        console.log("发送事件以及文件URL:", fileURL)
      }
    },
    mounted() {//在模板编译完成后执行
      Event.$on('senderA', name => {
        this.name = name;//箭头函数内部不会产生新的this，这边如果不用=>,this指代Event
      })
      Event.$on('senderB', age => {
        this.age = age;
      })
    },
    components: {
      'my-a': A,
      'my-b': B,
      NameListener,
      DrawBoard
    },
    watch: {
      dataURL: function (val) {
        console.log("BUS里面的dataURL发生改变了")
      },
      fileURL: function (val) {
        console.log("发送事件就放这吧")
      },
      name: (val, older) => {
        console.log(val + '===>' + older)
      }
    }
  }
</script>

